Storyline

In Venice, California, Kelley Tanner and Jonas Trumball are homeless teenagers that live on the beach and spend the day using drugs, drinking booze and shoplifting to survive. One day, Jonas overhears a conversation in a parking area between a woman named Evelyn and her housekeeper, and Evelyn tells that she will travel for one month with her husband David and she gives the alarm code to her servant. Jonas sees the chance to rob the house and brings Kelley with him. Kelley is needy of family love since she was a foster girl that left her foster house to live on the streets, and she spend the days watching to home videos of Evelyn, David, their son Michael, who has a poster of &quot;The Kid&quot; in his room, and their deceased daughter Stephanie. But Jonas is interested in robbing as much as possible to start a new life in Mexico. He meets a dangerous criminal to deal the jewelry and the Porsches of the family. But the family returns and Kelley and Jonas need to flee from the house. When Kelley... 


